import * as React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import { AntDesign, MaterialIcons } from '@expo/vector-icons';

// Screen import
import HomeScreen from '../screens/HomeScreen';
import AddTaskScreen from '../screens/AddTaskScreen';

const HomeStack = createNativeStackNavigator();
const AddTaskStack = createNativeStackNavigator();

const Tab = createBottomTabNavigator();

const HomeStackScreen = () => (
    <HomeStack.Navigator>
        <HomeStack.Screen
                name="HomeStack"
                component={HomeScreen}
                options={{
                    title: "Home",
                    headerShown: false
                }}
            />
    </HomeStack.Navigator>
);

const AddTaskStackScreen = () => (
    <AddTaskStack.Navigator>
        <AddTaskStack.Screen
                name="AddTaskStack"
                component={AddTaskScreen}

                options={{
                    title: "Create New Task",
                    animation: 'none',
                    headerShadowVisible: false,
                    headerTitleAlign: "center",

                    headerShown: false,
                    headerBackTitle: true,
                    headerBackVisible: true
                }}
            />
    </AddTaskStack.Navigator>
);



const AppNavigator = () => {
    return (
        <NavigationContainer>
            <Tab.Navigator
                screenOptions={{
                    tabBarStyle:{
                        backgroundColor: '#094FAF',
                        borderTopRightRadius: 25,
                        borderTopLeftRadius: 25,
                        height: 70
                    }
                }}
            >
                <Tab.Screen
                    name="Home"
                    component={HomeStackScreen}
                    options={{
                        tabBarIcon: () => <AntDesign name="home" size={35} color="#fff" />,
                        headerShown: false,
                        tabBarLabel: ''
                    }}
                />

                <Tab.Screen
                    name="AddTask"
                    component={AddTaskStackScreen}
                    options={{
                        tabBarIcon: () => <MaterialIcons name="add-box" size={35} color="#fff" />,
                        tabBarLabel: ''
                    }}
                />
            </Tab.Navigator>
        </NavigationContainer>
    );
};

export default AppNavigator;
